import React from 'react';
import './App.css';
import { Link } from 'react-router-dom';

function Header() {
    return (
        <nav>
            <h3>Kopi Mahal PABW</h3>
            <ul className='nav-links'>
                <Link>
                    <li>CSV</li>
                </Link>
                <Link>
                    <li>XML</li>
                </Link>
                <Link>
                    <li>Json</li>
                </Link>


            </ul>
        </nav>
    );
}

export default Header;
